import styled from 'styled-components'

const Container = styled.div`
  width: 100%;  
  margin: 0;
  padding: 0;
  box-sizing: border-box;
  background: #green;  


`

const Body = styled.div`
  width: 100%;  
`



export {
  Container,
  Body
}
